import React, { useEffect } from "react";
import WebFont from "webfontloader";

export default function Header() {
  useEffect(() => {
    WebFont.load({
      google: {
        families: ["Droid Sans", "Chilanka"],
      },
    });
  }, []);

  return (
    <>
    {/* Page title */}
      <div className="font-loader">
        <h1 className="header text-white text-center text-2xl">
          The Writer's Cave
        </h1>

        {/* Navigation Bar */}
        <nav className>
            <ul className = " flex text-white">
                <li className="mr-3"> 
                    <a className = "inline-block" href = "#"> My Writings</a>
                </li>
                <li className="mr-3">  
                <a className = "inline-block" href = "#"> Inspirations</a>
                </li>
                <li className="mr-3"> <a className = "inline-block" href = "#"> Write Anything </a> </li>
            </ul>
        </nav>

      </div>
    </>
  );
}
